window.bookSummaryJSON = "<p><b>Once, in a cottage above the cliffs on the Dark Sea of Darkness, there lived three children and their trusty dog, Nugget. </b></p> <p>Janner Igiby, his brother, Tink, and their disabled sister, Leeli, are gifted children as all children are, loved well by a noble mother and ex-pirate grandfather. But they will need all their gifts and all that they love to survive the evil pursuit of the venomous Fangs of Dang, who have crossed the dark sea to rule the land with malice. The Igibys hold the secret to the lost legend and jewels of good King Wingfeather of the Shining Isle of Anniera. </p> <p>Full of characters rich in heart, smarts, and courage, <i>On the Edge of the Dark Sea of Darkness</i> is a tale children of all ages will cherish and families can listen to together. </p> <p>This audiobook includes a PDF of maps, illustrations, and more. </p> <p><b>PLEASE NOTE: When you purchase this title, the accompanying PDF will be available in your Audible Library along with the audio.</b> </p>"; 
